import './App.css';
import LoginPage from './views/login/components/LoginPage'
import HomePage from './views/dashboard/components/HomePage'

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';


function App() {
  return (
    <div className="App">
            <Router>
        < Routes>
          <Route path="/home-page">
            <HomePage />
          </Route>
          <Route path="/">
            <LoginPage />
          </Route>
        </ Routes>
</Router>
  </div>


  );

}

export default App;
